import React from "react";
import { Link } from "react-router-dom";

export default function HomePage({ cards, loading, error }) {
  return (
    <div
      style={{
        maxWidth: "1200px",
        margin: "20px auto",
        padding: "20px",
        fontFamily: "'Segoe UI', Tahoma, Geneva, Verdana, sans-serif",
      }}
    >
      <div
        style={{
          textAlign: "center",
          marginBottom: "40px",
          padding: "20px",
          backgroundColor: "#f0f4f8",
          borderRadius: "12px",
          boxShadow: "0 4px 12px rgba(0,0,0,0.05)",
        }}
      >
        <h1 style={{ color: "#007bff", fontWeight: "700" }}>Bienvenido a WhaleCorp</h1>
        <p style={{ fontSize: "18px", maxWidth: "600px", margin: "0 auto", color: "#555" }}>
          A page made with love ♥, Solari is the GOAT
        </p>
      </div>

      {loading ? (
        <div style={{ textAlign: "center", margin: "50px 0" }}>
          <div className="spinner" />
          <p style={{ color: "#777", fontSize: "16px" }}>Cargando personajes...</p>
        </div>
      ) : error ? (
        <div style={{ textAlign: "center", margin: "50px 0", color: "#dc3545" }}>
          <p>Error al cargar los datos: {error}</p>
          <button
            onClick={() => window.location.reload()}
            style={{
              padding: "10px 20px",
              background: "#007bff",
              color: "white",
              border: "none",
              borderRadius: "6px",
              cursor: "pointer",
              fontWeight: "600",
              fontSize: "16px",
              marginTop: "15px",
              boxShadow: "0 2px 6px rgba(0,123,255,0.4)",
              transition: "background-color 0.3s ease",
            }}
            onMouseOver={(e) => (e.currentTarget.style.backgroundColor = "#0056b3")}
            onMouseOut={(e) => (e.currentTarget.style.backgroundColor = "#007bff")}
          >
            Reintentar
          </button>
        </div>
      ) : cards.length === 0 ? (
        <div style={{ textAlign: "center", margin: "50px 0", color: "#6c757d", fontSize: "18px" }}>
          <p>No hay tarjetas disponibles</p>
          <Link
            to="/login"
            style={{
              display: "inline-block",
              marginTop: "20px",
              padding: "10px 25px",
              background: "#007bff",
              color: "white",
              textDecoration: "none",
              borderRadius: "8px",
              fontWeight: "600",
              boxShadow: "0 2px 6px rgba(0,123,255,0.4)",
              transition: "background-color 0.3s ease",
            }}
            onMouseOver={(e) => (e.currentTarget.style.backgroundColor = "#0056b3")}
            onMouseOut={(e) => (e.currentTarget.style.backgroundColor = "#007bff")}
          >
            Inicia sesión como administrador
          </Link>
        </div>
      ) : (
        <div>
          <h2
            style={{
              textAlign: "center",
              marginBottom: "30px",
              color: "#333",
              fontWeight: "700",
              letterSpacing: "1px",
            }}
          >
            Pending Raids
          </h2>
          <div
            style={{
              display: "grid",
              gridTemplateColumns: "repeat(4, 1fr)", // 4 columnas
              gap: "24px",
            }}
          >
            {cards.map((card, index) => (
              <div
                key={index}
                style={{
                  borderRadius: "16px",
                  overflow: "hidden",
                  boxShadow: "0 10px 20px rgba(0,0,0,0.08)",
                  backgroundColor: "white",
                  display: "flex",
                  flexDirection: "column",
                  cursor: "default",
                  transition: "transform 0.2s ease, box-shadow 0.2s ease",
                }}
                onMouseEnter={(e) => {
                  e.currentTarget.style.transform = "translateY(-8px)";
                  e.currentTarget.style.boxShadow = "0 20px 30px rgba(0,0,0,0.12)";
                }}
                onMouseLeave={(e) => {
                  e.currentTarget.style.transform = "translateY(0)";
                  e.currentTarget.style.boxShadow = "0 10px 20px rgba(0,0,0,0.08)";
                }}
              >
                <div
                  style={{
                    padding: "18px 24px",
                    backgroundColor: "#e9f1ff",
                    borderBottom: "1px solid #d0dffb",
                    userSelect: "none",
                  }}
                >
                  <h3
                    style={{
                      margin: 0,
                      color: "#0056b3",
                      fontWeight: "700",
                      fontSize: "1.4rem",
                      lineHeight: "1.1",
                    }}
                  >
                    {card.title}
                  </h3>
                  <div
                    style={{
                      display: "flex",
                      justifyContent: "space-between",
                      fontSize: "14px",
                      color: "#7483a2",
                      marginTop: "8px",
                      fontWeight: "600",
                    }}
                  >
                    <span>{card.date || "Fecha no asignada"}</span>
                    <span>{card.time || "Hora no asignada"}</span>
                  </div>
                </div>

                <div
                  style={{
                    padding: "18px 24px",
                    flexGrow: 1,
                    display: "grid",
                    gridTemplateColumns: "repeat(2, 1fr)",
                    gap: "14px",
                    overflowY: "auto",
                    maxHeight: "210px",
                    userSelect: "text",
                  }}
                >
                  {card.characters.length === 0 ? (
                    <p
                      style={{
                        color: "#8a9abf",
                        textAlign: "center",
                        padding: "30px 0",
                        gridColumn: "1 / -1",
                        fontWeight: "500",
                        fontStyle: "italic",
                      }}
                    >
                      Tarjeta pendiente de asignación
                    </p>
                  ) : (
                    card.characters.map((char, charIndex) => (
                      <div
                        key={charIndex}
                        style={{
                          padding: "12px",
                          borderRadius: "12px",
                          backgroundColor: "#dceeff",
                          display: "flex",
                          flexDirection: "column",
                          alignItems: "center",
                          fontWeight: "700",
                          color: "#004a99",
                          userSelect: "none",
                          boxShadow: "0 2px 6px rgba(0,75,140,0.2)",
                          transition: "background-color 0.2s ease",
                        }}
                        title={char.label}
                      >
                        <div>{char.name}</div>
                        {char.label && (
                          <div
                            style={{
                              marginTop: "6px",
                              fontSize: "12px",
                              fontWeight: "600",
                              padding: "3px 9px",
                              borderRadius: "9999px",
                              backgroundColor: "#a3c1ff",
                              color: "#003377",
                              userSelect: "text",
                            }}
                          >
                            {char.label}
                          </div>
                        )}
                      </div>
                    ))
                  )}
                </div>
              </div>
            ))}
          </div>
        </div>
      )}
    </div>
  );
}
